Meeting_Participatio_1.query:
q = load "${App.Datasets.PACCRM_Meeting_Freeze_tp.FullyQualifiedName}";
q = filter q by 'IsInvitee' == "true";
result = group q by ('Invitee.Subject', 'Invitee.StartDateTime_Year', 'Invitee.StartDateTime_Month', 'Invitee.StartDateTime_Day', 'Invitee.StartDateTime_Hour', 'Invitee.StartDateTime_Minute', 'User.Name');
result = foreach result generate q.'Invitee.Subject' as 'Invitee.Subject', q.'Invitee.StartDateTime_Day' + "." + q.'Invitee.StartDateTime_Month' + "." + q.'Invitee.StartDateTime_Year' + " " + q.'Invitee.StartDateTime_Hour' + ":" + q.'Invitee.StartDateTime_Minute' as 'Date & Time', q.'User.Name' as 'User.Name', unique(q.'Participant.User.Name') as 'Inv. (0) / Par. (1)';
result = order result by ('Date & Time' desc);
result = limit result 2000;

Butterfly_Chart_1.query:
q1 = load "${App.Datasets.Riskmarker_for_Background_tp.FullyQualifiedName}";
q2 = load "${App.Datasets.PACCRM_PACCRM_Freeze_tp.FullyQualifiedName}";
q = cogroup q1 by ('ftxt_EAXAlphabetical__c', 'ftxt_EAYAlphabetical__c') full, q2 by ('Risk.ftxt_EAXAlphabetical__c', 'Risk.ftxt_EAYAlphabetical__c');
q = foreach q generate coalesce(q1.'ftxt_EAXAlphabetical__c', q2.'Risk.ftxt_EAXAlphabetical__c') as 'ftxt_EAXAlphabetical__c', coalesce(q1.'ftxt_EAYAlphabetical__c', q2.'Risk.ftxt_EAYAlphabetical__c') as 'ftxt_EAYAlphabetical__c', coalesce(sum(q2.'Risk.fnum_Color__c'), 0) + coalesce(sum(q1.'fnum_Color__c'), 0) as 'Sum of Color', count(q2) as 'BubbleSize', coalesce(sum(q2.'Risk.fcur_ExpectedMonetaryValue__c'), 0) + coalesce(sum(q1.'fcur_ExpectedMonetaryValue__c'), 0) as 'Sum of Expected Monetary Value', count(q2) as 'Number of Risks';
q = order q by ('ftxt_EAXAlphabetical__c' asc, 'ftxt_EAYAlphabetical__c' asc);
q = limit q 2000;
